    false,nt"url": null,nt"notes": "The Apalachicola Bay National Estuarine
    Research Reserve and the NOAA Office for Coastal Management worked together to map
    benthic habitats within Apalachicola Bay, Florida. The bay and the lower portions
    of four distributaries were surveyed on 11-22 October 1999 using three benthic sampling
    techniques. This data set represents the sediment grain size and organic content
    information gathered from grab sampling. Grabs were collected at 136 stations throughout
    the bay.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
